import React from 'react';
import './App.css';

function MyBlog()
{
      let str = "aaaaaaaaaaas dddddddd fffffffffffff ssssssssss ffffffffffffffffff     rrrrrrrrrrrrrrrrrrrrrrrr rrrrrrrrrrrrrrrrrrrrrrrr rrrrrrrrrrrrrrrrr"
      return (
         <>
        <div class="Blog d-flex flex-column">
         <div class='Text'>
            <span style={{color:'black'}}>Title--</span> {str}
         </div>

         <div class='Text'>
            {str}
         </div>

         <div class='Text'>
            {str}
         </div>
          
      </div>
      </>
      )
}

export default MyBlog;
